const Input = styled('input')({
    border:'2px solid',
    borderRadius:'5px',
    fontSize:'25px',
    width:'50px',
    height:'50px'
})

export default function OTP_UI({ email }) {
    return (
        <>
            <p style={{ fontSize: '22px', fontFamily: 'Arial' }}>
                We sent an OTP to your email { }
            </p>
            <form>
                <Input type="number"/>
            </form>
        </>
    )
}
